import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = () => {
	return (
		<div>
			My Posts
			<div>
				<textarea></textarea>
				<button>Add Post</button>
			</div>
			<div className={s.posts}>
				<Post message="Hi, who are u" />
				<Post message="y'oyoyoy" />
			</div>
		</div>
	);
};

export default MyPosts;
